					"deDE": "Euer Verbrennungsschaden wird um 40% Eures kritischen Trefferschadens und um 5% pro 20 Intelligenz erhht. (Aktueller Bonus: [Crit_Damage_Percent * 0.4 + (floor(Intelligence_Total / 20) * 0.05) * 100]%)\n\nTags: Verbrennung, Schaden, Kritische Treffer, Intelligenz.",
