					"frFR": "Vos dgts de brlure sont augments d'un montant gal  40% vos dgts critiques. Ce montant est augment de 5% supplmentaires par tranche de 20 points d'intelligence que vous avez. (Bonus actuel: [Crit_Damage_Percent * 0.4 + (floor(Intelligence_Total / 20) * 0.05) * 100]%)\n\nTags: Brlure, Dgts, Coups critiques, Intelligence.",
					"itIT": "I tuoi danni da fiamme sono aumentati del 40% dei tuoi danni critici e vengono aumentati ulteriormente del 5% per ogni 20 Intelligenza. (Bonus attuale: [Crit_Damage_Percent * 0.4 + (floor(Intelligence_Total / 20) * 0.05) * 100]%)\n\nTags: Bruciatura, Danni, Colpi critici, Intelligenza.",
