					"koKR": "    40% ,  20 5%  . ( : [Crit_Damage_Percent * 0.4 + (floor(Intelligence_Total / 20) * 0.05) * 100]%)\n\nTags: , , , .",
					"plPL": "Zadawane przez ciebie obraenia od podpalenia s zwikszone o rwnowarto 40% twoich obrae od trafie krytycznych oraz dodatkowo o 5% za kade posiadane 20 pkt. inteligencji. (Aktualna premia: [Crit_Damage_Percent * 0.4 + (floor(Intelligence_Total / 20) * 0.05) * 100]%)\n\nTags: Podpalenie, Obraenia, Trafienia Krytyczne, Inteligencja.",
					"ptBR": "Seu dano flamejante  aumentado em 40% do seu dano de acerto crtico, sendo aumentado ainda mais em 5% para cada 20 de Inteligncia que voc tenha (bnus atual: [Crit_Damage_Percent * 0.4 + (floor(Intelligence_Total / 20) * 0.05) * 100]%).\n\nTags: Queimadura, Dano, Acertos Crticos, Inteligncia.",
