					"trTR": "Ate Topu veya Meteor kullanm, bu Yetenein sonraki kullanmlarndaki Kritik Vuru htimalini 5 saniyeliine +5% artrr. Art en fazla +15% olabilir. Ek birikmeler bu zamanlaycy sfrlamaz.\n\nTags: Kritik Vurular.",
